script: |
  super -f tsv -I q1565.sql | sort > q1565.out

vector: true

inputs:
  - name: q1565.sql
    data: |
      SELECT DISTINCT - 15 AS col0 FROM tab0 WHERE 83 NOT IN ( - col2 + + ( - ( + - col0 ) ) + + + col0 + + col0 + col1 * - - ( col2 ) );
  - name: tab0

outputs:
  - name: q1565.out
    data: |
      -15
